import axios from 'axios';

const axiosInstance = axios.create({
	headers: {
		'Content-Type': 'application/json;charset=UTF-8',
	}
}); 

export function getCountryCodes() {
	return axiosInstance({
		url:"https://pkgstore.datahub.io/core/country-list/data_json/data/8c458f2d15d9f2119654b29ede6e45b8/data_json.json",
		method: "GET",
	})
	.then((response) => {
		return response;
	}, (error) => {
		throw Error(error);
	});
}

export function getTimeseriesData(iso2) {
	return axiosInstance({
		url: "https://wuhan-coronavirus-api.laeyoung.endpoint.ainize.ai/jhu-edu/timeseries",
		method: "GET",
		params: {
			iso2,
			onlyCountries:true,
		}
	})
	.then((response) => {
		return response;
	}, (error) => {
		throw Error(error);
	});
}
